import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import React from 'react';
import Slider from "react-slick";


export default function PlayerCarousel() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
    };

    return (
      <Slider {...settings}>
        <div>
          <p class="tile">This will be one slider.</p>

          <p class="tile">this will be the second part slot for info. </p>
        </div>
        <div>
          <p class="tile">This is slider 2. </p>
        </div>
      </Slider>
    );
  }
